import React from 'react';
import "./CampaignManager.css";
import Header from './Header';
import AddCircleIcon from '@material-ui/icons/AddCircle';
import { Avatar, IconButton } from '@material-ui/core';
import { useHistory } from "react-router-dom";
import CampaignBox from "./CampaignBox.js";



function CampaignManager() {

    const history = useHistory();

    const handleSubmitNewCampaign = e => {
        e.preventDefault();
        history.push("/create-campaign");
    }

    return (
        <div className = "campaignManager">
            <Header />

            <div className = "existingCampaigns">
                <h3>Your Campaigns</h3>
            </div>

            <div className = "createCampaign">
                {/* <IconButton onClick = {handleSubmitNewCampaign}>
                    <AddCircleIcon fontSize = "large" />
                </IconButton> */}
                <button onClick = {handleSubmitNewCampaign}>
                    + Create New Campaign
                </button>
            </div>

            <div className = "campaignsOfOthers">
                <CampaignBox
                    title = "BLM"
                    description = "Breonna Taylor"
                    username = "arda"
                    target = "1000"
                    location = 'Oakland'
                    timestamp = {new Date().toUTCString()}
                    image = ""
                />
            </div>
        </div>
    )
}

export default CampaignManager
